import styled from 'styled-components';

const Card = styled.div`
  width: 483px;
  height: 392px;
  box-shadow: 0px 1px 23px rgba(31, 35, 36, 0.04), 0px 12px 44px rgba(47, 61, 65, 0.16);
  border-radius: 4px;
  color: black;
`;

export default Card;
